import React, { useState } from "react";


const Search = () => {
    const [ searchCity, setSearchCity ] = useState('');
    const [ searchEntryWeek, setSearchEntryWeek ] = useState('');
    const [ searchDepartureWeek, setSearchDepartureWeek ] = useState('');
    const [ searchPrize, setSearchPrize ] = useState('');
    const [ searchProfession, setSearchProfession ] = useState('');
    const [ status, setStatus ] = useState ()

    const handleCityChange = e => {
        setSearchCity(e.target.value)
    }
    const handleEntryWeekChange = e => {
        setSearchEntryWeek(e.target.value)
    }
    const handleDepartureWeekChange = e => {
        setSearchDepartureWeek(e.target.value)
    }
    const handlePrizeChange = e => {
        setSearchPrize(e.target.value)
    }
    const handleProfessionChange = e => {
        setSearchProfession(e.target.value)
    }

    const handleSubmit = e => {
        e.preventDefault()
        setStatus('loading')
    }

    if (status === 'loading') {
        return (
            <p>Buscando...</p>
        )
    }

    return (
        <form onSubmit={handleSubmit}>
            <input type="text" value={searchCity} onChange={handleCityChange} placeholder="Ciudad" />
            <input type="date" value={searchEntryWeek} onChange={handleEntryWeekChange} placeholder="Entrada" />
            <input type="date" value={searchDepartureWeek} onChange={handleDepartureWeekChange} placeholder="Salida" />
            <input type="number" min="150" max="1000" value={searchPrize} onChange={handlePrizeChange} placeholder="precio/semana" />
            <input type="text" value={searchProfession} onChange={handleProfessionChange} placeholder="profesion afÃ­n" />
            <button>Enviar</button>
            {status}
        </form>
    );
}

export default Search;
